                  type: string
                  description: "The destination's zipcode. Must not be greater than 255 characters."
                  example: '3810 AN'
                  nullable: false
                to_city:
                  type: string
                  description: "The destination's city. Must not be greater than 255 characters."
                  example: Amersfoort
